import React from "react";
import { userParams } from "react-router-dom";

const ArticlePage = () => {
  let { name } = userParams().name;
  return (
    <>
      <header>
        <div class="content-wrap">
          <h1 class="fancy">This is an {name} article </h1>
        </div>
      </header>
    </>
  );
};

export default ArticlePage;
